import {image_to_gltf} from "./pix2gltfr/Cargo.toml";

console.log(image_to_gltf);

const fileInput = document.querySelector("#file-input") as HTMLInputElement;

const mapFn = <T,R>(fn: (x: T) => R) => (array: Array<T>) => array.map(fn);

const workflow = async (event: Event & { target: HTMLInputElement }) => {
  const preCanvas = document.querySelector("#img-display") as HTMLCanvasElement;
  const postCanvas = document.querySelector("#img-display") as HTMLCanvasElement;
  const offDomImage = new Image();
  const fileReader = new FileReader();
  preCanvas.width = offDomImage.width;
  preCanvas.height = offDomImage.height;
  const ctx = preCanvas.getContext("2d");
  ctx.drawImage(offDomImage, 0, 0);
}

const onImageLoad = () => {

  const data = ctx.getImageData(0,0, offDomImage.width, offDomImage.height);
  console.log(data);
  try {
    const gltf = image_to_gltf(data);
    console.log(gltf);
  } catch (e) {
    console.error(e);
  }
}

const fileReaderOnLoad = (event) => {
  const data = event.target.result.toString();
  offDomImage.src = data;
  offDomImage.onload = onImageLoad;
}


const fileToDataURL = async (file: File): Promise<string | ArrayBuffer> => {
  const tempFR = new FileReader();
  return new Promise((resolve, reject) => {
    tempFR.onerror = () => {
      tempFR.abort();
      reject(new DOMException("Problem parsing input file."));
    };

    tempFR.onload = () => {
      resolve(tempFR.result);
    };

    tempFR.readAsDataURL(file);
  });  
}
const fileEventToFileList = (event: Event & { target: HTMLInputElement }) => (event.target.files)
const fileListToDataURLArray = async (fileList: FileList) => await Promise.allSettled(
  Array
    .from(fileList)
    .map(file => fileToDataURL(file)));
const dataUrlToImage = (dataUrl: string) => {
  const img = new Image();
  img.src = dataUrl;
  return img;
}
const dataUrlArrayToImageArray = map.bind(null, dataUrlToImage);

const imageToCanvas = (image: HTMLImageElement, canvasId: string) => {
  const canvas = document.createElement("canvas");
  canvas.id = canvasId;
  const ctx = canvas.getContext("2d");
  canvas.width = image.width;
  canvas.height = image.height;
  ctx.drawImage(image, 0, 0);
  return canvas;
}

const imageArrayToCanvasArray = mapFn(imageToCanvas);

const canvasToImageData = (canvas: HTMLCanvasElement) => canvas.getContext("2d").getImageData(0, 0, canvas.width, canvas.height);

const canvasArrayToImageDataArray = mapFn(canvasToImageData);







